;$(document).on('orViewLoaded',function(e,r){$(e.target).find('.or-qrcode').mouseover(function(){let element=this;if($(element).children().length>0)return;let wrapper=$('<div class="or-info-popup"></div>');$(element).append(wrapper);var e=$(element).attr('data-qrcode');$(wrapper).qrcode({render:'div',text:e,fill:'currentColor'});wrapper.attr('title','')})});